**Answer**: The correct way to write the `if` statement is:

```c
if (a == 0 && b == 0) {
    // ...
}
```

or, if you want to check that neither is zero:

```c
if (a != 0 && b != 0) {
    // ...
}
```

(Use `&&` for logical AND, not `&`.)

